import './editBar.css'
import undo from '../img/editBarIcons/Undo.png'
import redo from '../img/editBarIcons/Redo.png'

export function EditBar() {
    return (
        <div className="editBar">
            <div className='editButtons'>
                <img src={undo} alt='undo' />
            </div>
        </div>
    );
}
